    true,nt"url": null,nt"notes": "<p>Section 10332 of the Affordable Care
    Act amends section 1874 of the Social Security Act (the Act) by adding a new subsection
    (e) requiring standardized extracts of Medicare claims data under prts A, B, and
    D to be made available to qualified entities for the evaluation of the performance
    of providers and suppliers.  Qualified entities may use the information obtained
    under section 1874(e) of the Act for the purpose of evaluating the performance of
    providers and suppliers, and to generate public reports regarding such performance.</p>n",nt"owner_org":
